            <div>
                Lorem ipsum dolor sit amet, consectetur adipisicing elit. Culpa autem ullam maxime dicta dolores minus
                dolorum expedita libero ad facere laborum nemo fuga facilis, molestiae earum ut vero. Aperiam, ex?
            </div>
        </DashboardItem>
    );
};

export default DashboardTimeStatItem;
